import React, {useState, useEffect} from "react";

function Registration (props) {

    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');
    const [secondPassword, setSecondpassword] = useState('');

    function sendValues() {

    }

    return (
        <div className="registrationPage">
            <form>
                <div className="form-group row">
                    <label>
                        Емейл
                    </label>
                    <input type="text" className="form-control" onChange={(event) => setEmail(event.target.value)}/>
                </div>
                <div className="form-group row">
                    <label>
                        Пароль
                    </label>
                    <input type="text" className="form-control" onChange={(event) => setPassword(event.target.value)}/>
                </div>
                <div className="form-group row">
                    <label>
                        Повторіть пароль
                    </label>
                    <input type="text" className="form-control" onChange={(event) => setSecondpassword(event.target.value)}/>
                </div>
                <div className="form-group row">
                    <input type="button" id="registrateBtn" className="btn btn-primary linkButton" value="Зареєструватись" onClick={sendValues}/>
                </div>
            </form>
        </div>
    );
}

export default Registration;
